#include "Resource.h"
#include "IERG3810_TFTLCD.h"   /*  lcd_wr_reg / lcd_wr_data / lcd_drawDot etc. */

#define LCD_SCREEN_WIDTH   240
#define LCD_SCREEN_HEIGHT  320

#define ILI9341_CMD_CASET   ((u16)0x2A)
#define ILI9341_CMD_PASET   ((u16)0x2B)
#define ILI9341_CMD_RAMWR   ((u16)0x2C)

/* ────────────────────────── Internal ────────────────────────── */
static void lcd_setAddressWindow(u16 x0, u16 y0,
                                 u16 x1, u16 y1)
{
  lcd_wr_reg(ILI9341_CMD_CASET);
  lcd_wr_data(x0 >> 8);
  lcd_wr_data(x0 & 0xFF);
  lcd_wr_data(x1 >> 8);
  lcd_wr_data(x1 & 0xFF);

  lcd_wr_reg(ILI9341_CMD_PASET);
  lcd_wr_data(y0 >> 8);
  lcd_wr_data(y0 & 0xFF);
  lcd_wr_data(y1 >> 8);
  lcd_wr_data(y1 & 0xFF);
}



/* ────────────────────────── Bitmap Drawing ────────────────────────── */
void lcd_drawBitmap16(s16 x, s16 y, const Bitmap16 *bmp)
{
  s32 x0;          /* Clipped left coordinate for the draw window */
  s32 y0;          /* Clipped bottom coordinate for the draw window */
  s32 x1;          /* Clipped right coordinate (exclusive upper bound) */
  s32 y1;          /* Clipped top coordinate (exclusive upper bound) */
  s32 srcX = 0;    /* Horizontal offset into the bitmap once clipping happens */
  s32 srcY = 0;    /* Vertical offset into the bitmap once clipping happens */
  u16 row;         /* Iterator for LCD scanlines */
  u16 col;         /* Iterator for pixels within a scanline */
  u16 drawWidth;   /* Width of the portion we actually send to the LCD */
  u16 drawHeight;  /* Height of the portion we actually send to the LCD */

  /* Bail out immediately when the bitmap pointer or geometry is invalid */
  if ((bmp == 0) || (bmp->data == 0) || (bmp->width == 0) || (bmp->height == 0))
    return;

  /* Convert to signed working coordinates and build unclipped bounds */
  x0 = (s32)x;
  y0 = (s32)y;
  x1 = (s32)x + (s32)bmp->width;
  y1 = (s32)y + (s32)bmp->height;

  /* Early-out when the bitmap lies completely outside the panel area */
  if (x1 <= 0 || y1 <= 0) return; /* Completely outside (left/below) */
  if (x0 >= LCD_SCREEN_WIDTH || y0 >= LCD_SCREEN_HEIGHT) return; /* Completely outside (right/above) */

  /* Clamp to the visible region and advance the source start offsets accordingly */
  if (x0 < 0) {
    srcX = -x0;   /* Skip the columns that were outside the panel */
    x0 = 0;       /* Clamp the draw window to the left edge */
  }
  if (y0 < 0) {
    srcY = -y0;   /* Skip the rows that were outside the panel */
    y0 = 0;       /* Clamp the draw window to the bottom edge */
  }
  if (x1 > LCD_SCREEN_WIDTH) x1 = LCD_SCREEN_WIDTH;   /* Trim right edge to panel width */
  if (y1 > LCD_SCREEN_HEIGHT) y1 = LCD_SCREEN_HEIGHT; /* Trim top edge to panel height */

  drawWidth = (u16)(x1 - x0);   /* Visible width produced by clipping */
  drawHeight = (u16)(y1 - y0);  /* Visible height produced by clipping */
  if ((drawWidth == 0u) || (drawHeight == 0u)) return; /* Nothing left to render */

  /* Stream each visible row into LCD GRAM after selecting the clipped window */
  for (row = 0u; row < drawHeight; row++)
  {
    s32 srcRow = srcY + row; /* Row index inside the bitmap texture */
    /* Program the LCD to accept data for the current clipped scanline */
    /* Y coordinate inverted: bitmap row 0 draws at highest Y */
    lcd_setAddressWindow((u16)x0,
                         (u16)(y0 + (drawHeight - 1u - row)),
                         (u16)(x0 + drawWidth - 1u),
                         (u16)(y0 + (drawHeight - 1u - row)));
    /* Switch the controller into write mode before pushing pixels */
    lcd_wr_reg(ILI9341_CMD_RAMWR);

    for (col = 0u; col < drawWidth; col++)
    {
      s32 srcCol = srcX + col;                        /* Column inside the bitmap */
      u32 index = (u32)srcRow * bmp->width + (u32)srcCol; /* Convert 2D to 1D index */
      /* Read the corresponding texel from the bitmap and stream it out */
      u16 pixel = RESOURCE_READ_PIXEL(bmp->data, index);
      lcd_wr_data(pixel);
    }
  }
}

/* Transparent color version: skips pixels of the specified color (draws point by point, slower but allows layering) */
void lcd_drawBitmap16_ColorKey(s16 x, s16 y, const Bitmap16 *bmp,
                               u16 colorNotToPrint)
{
  s32 x0;          /* Left bound that will hit the panel */
  s32 y0;          /* Bottom bound that will hit the panel */
  s32 x1;          /* Right edge after clipping (exclusive) */
  s32 y1;          /* Top edge after clipping (exclusive) */
  s32 srcX = 0;    /* Horizontal offset into the source bitmap */
  s32 srcY = 0;    /* Vertical offset into the source bitmap */
  u16 row;         /* Current row being drawn */
  u16 col;         /* Current column being drawn */
  u16 drawWidth;   /* Width of the visible span */
  u16 drawHeight;  /* Height of the visible span */

  /* Skip empty resources so we avoid unnecessary math below */
  if ((bmp == 0) || (bmp->data == 0) || (bmp->width == 0) || (bmp->height == 0))
    return;

  /* Build unclipped rectangle using signed math so negative inputs are preserved */
  x0 = (s32)x;
  y0 = (s32)y;
  x1 = (s32)x + (s32)bmp->width;
  y1 = (s32)y + (s32)bmp->height;

  /* Skip drawing when the sprite is completely off screen */
  if (x1 <= 0 || y1 <= 0) return;
  if (x0 >= LCD_SCREEN_WIDTH || y0 >= LCD_SCREEN_HEIGHT) return;

  /* Clip to the visible area and track the offset where bitmap sampling should start */
  if (x0 < 0) {
    srcX = -x0;   /* Offset bitmap sampling to ignore clipped columns */
    x0 = 0;       /* Keep drawing from the visible boundary */
  }
  if (y0 < 0) {
    srcY = -y0;   /* Offset bitmap sampling to ignore clipped rows */
    y0 = 0;       /* Keep drawing from the visible boundary */
  }
  if (x1 > LCD_SCREEN_WIDTH) x1 = LCD_SCREEN_WIDTH;   /* Limit draw area at right border */
  if (y1 > LCD_SCREEN_HEIGHT) y1 = LCD_SCREEN_HEIGHT; /* Limit draw area at top border */

  drawWidth = (u16)(x1 - x0);   /* Width of the on-screen span */
  drawHeight = (u16)(y1 - y0);  /* Height of the on-screen span */
  if ((drawWidth == 0u) || (drawHeight == 0u)) return; /* All pixels clipped out */

  /* Traverse clipped region, collect consecutive opaque spans per row, then batch send to GRAM */
  for (row = 0u; row < drawHeight; row++)
  {
    /* Calculate current row index in bitmap */
    s32 srcRow = srcY + row;
    /* Convert to actual screen Y (inverted, bottom is row=0) */
    u16 destY = (u16)(y0 + (drawHeight - 1u - row));
    /* Start scanning from leftmost column of each row */
    col = 0u;

    /* Check each column, batch output opaque spans */
    while (col < drawWidth)
    {
      /* Locate current column in bitmap */
      s32 srcCol = srcX + (s32)col;
      /* Calculate 1D index value */
      u32 index = (u32)srcRow * bmp->width + (u32)srcCol;
      /* Read pixel color */
      u16 pixel = RESOURCE_READ_PIXEL(bmp->data, index);

      if (pixel == colorNotToPrint)
      {
        /* Skip transparent pixel, continue searching for next opaque starting point */
        col++;
        continue;
      }

      /* Found opaque pixel, start expanding into consecutive span */
      {
        /* Record starting column of consecutive span */
        u16 spanStart = col;
        u16 spanEnd;
        u16 spanCol;

        /* Start checking from next column */
        col++;
        while (col < drawWidth)
        {
          /* Calculate bitmap coordinates of next column */
          srcCol = srcX + (s32)col;
          index = (u32)srcRow * bmp->width + (u32)srcCol;
          /* Read pixel */
          pixel = RESOURCE_READ_PIXEL(bmp->data, index);
          /* Stop expansion if transparent color encountered */
          if (pixel == colorNotToPrint)
            break;
          /* Continue adding to consecutive span */
          col++;
        }
        /* Record span end position (exclusive) */
        spanEnd = col;

        /* Set GRAM window range for this consecutive span in one operation */
        lcd_setAddressWindow((u16)(x0 + spanStart),
                             destY,
                             (u16)(x0 + spanEnd - 1u),
                             destY);
        /* Send RAM write command */
        lcd_wr_reg(ILI9341_CMD_RAMWR);

        /* Stream all pixel data of this span sequentially */
        spanCol = spanStart;
        while (spanCol < spanEnd)
        {
          /* Recalculate this column's position in bitmap */
          srcCol = srcX + (s32)spanCol;
          index = (u32)srcRow * bmp->width + (u32)srcCol;
          /* Read pixel color */
          pixel = RESOURCE_READ_PIXEL(bmp->data, index);
          /* Send data directly to LCD */
          lcd_wr_data(pixel);
          spanCol++;
        }
      }
    }
  }
}

/* Force non-transparent pixels to a new color, useful for creating different color schemes of the same image */
void lcd_drawBitmap16_Colorize(s16 x, s16 y, const Bitmap16 *bmp,
                               u16 new_color, u16 colorNotToPrint)
{
  s32 x0;          /* Left edge after clipping */
  s32 y0;          /* Bottom edge after clipping */
  s32 x1;          /* Right edge (exclusive) after clipping */
  s32 y1;          /* Top edge (exclusive) after clipping */
  s32 srcX = 0;    /* Source bitmap X offset due to clipping */
  s32 srcY = 0;    /* Source bitmap Y offset due to clipping */
  u16 row;         /* Loop variable for Y */
  u16 col;         /* Loop variable for X */
  u16 drawWidth;   /* Effective width once clipped */
  u16 drawHeight;  /* Effective height once clipped */

  /* Validate callers so the recolor logic does not touch NULL memory */
  if ((bmp == 0) || (bmp->data == 0) || (bmp->width == 0) || (bmp->height == 0))
    return;

  /* As above, compute signed bounds so we can clip off-screen parts safely */
  x0 = (s32)x;
  y0 = (s32)y;
  x1 = (s32)x + (s32)bmp->width;
  y1 = (s32)y + (s32)bmp->height;

  /* Ignore calls that are completely outside the active panel */
  if (x1 <= 0 || y1 <= 0) return;
  if (x0 >= LCD_SCREEN_WIDTH || y0 >= LCD_SCREEN_HEIGHT) return;

  /* Clamp to screen edges and track new source offsets for the bitmap lookup */
  if (x0 < 0) {
    srcX = -x0;   /* Adjust source pointer for columns outside view */
    x0 = 0;       /* Clamp drawing to the visible area */
  }
  if (y0 < 0) {
    srcY = -y0;   /* Adjust source pointer for rows outside view */
    y0 = 0;       /* Clamp drawing to the visible area */
  }
  if (x1 > LCD_SCREEN_WIDTH) x1 = LCD_SCREEN_WIDTH;   /* Clip width when source spills off screen */
  if (y1 > LCD_SCREEN_HEIGHT) y1 = LCD_SCREEN_HEIGHT; /* Clip height when source spills off screen */

  drawWidth = (u16)(x1 - x0);   /* Visible width after clipping */
  drawHeight = (u16)(y1 - y0);  /* Visible height after clipping */
  if ((drawWidth == 0u) || (drawHeight == 0u)) return; /* No pixels to recolor */

  /* Recolor only non-transparent pixels, batch output to reduce window setup operations */
  for (row = 0u; row < drawHeight; row++)
  {
    /* Locate bitmap source row */
    s32 srcRow = srcY + row;
    /* Calculate actual screen Y coordinate (inverted vertical direction) */
    u16 destY = (u16)(y0 + (drawHeight - 1u - row));
    /* Start scanning from left end of this row */
    col = 0u;

    /* Check each column, batch overwrite consecutive opaque spans */
    while (col < drawWidth)
    {
      /* Calculate bitmap current column position */
      s32 srcCol = srcX + (s32)col;
      /* Convert to 1D array index */
      u32 index = (u32)srcRow * bmp->width + (u32)srcCol;
      /* Read original pixel value */
      u16 pixel = RESOURCE_READ_PIXEL(bmp->data, index);

      if (pixel == colorNotToPrint)
      {
        /* If transparent color, skip this column directly */
        col++;
        continue;
      }

      /* Found opaque pixel, start expanding consecutive span for batch coloring */
      {
        /* Record span start point */
        u16 spanStart = col;
        u16 spanEnd;
        u16 spanLen;

        /* Check next column */
        col++;
        while (col < drawWidth)
        {
          /* Locate next column position in bitmap */
          srcCol = srcX + (s32)col;
          index = (u32)srcRow * bmp->width + (u32)srcCol;
          /* Read pixel */
          pixel = RESOURCE_READ_PIXEL(bmp->data, index);
          /* Stop expansion when transparent color encountered */
          if (pixel == colorNotToPrint)
            break;
          /* Include in consecutive span */
          col++;
        }
        /* Record span end position (exclusive) */
        spanEnd = col;
        /* Calculate span length */
        spanLen = (u16)(spanEnd - spanStart);

        /* Set GRAM window for this consecutive span in one operation */
        lcd_setAddressWindow((u16)(x0 + spanStart),
                             destY,
                             (u16)(x0 + spanEnd - 1u),
                             destY);
        /* Send RAM write command */
        lcd_wr_reg(ILI9341_CMD_RAMWR);

        /* Continuously send new color value to overwrite original pixels */
        while (spanLen > 0u)
        {
          /* Uniformly color to target color */
          lcd_wr_data(new_color);
          spanLen--;
        }
      }
    }
  }
}

void lcd_clearBitmapArea(s16 x, s16 y, const Bitmap16 *bmp, u16 bg_color)
{
  s32 x0;            /* Clipped rectangle left edge */
  s32 y0;            /* Clipped rectangle bottom edge */
  s32 x1;            /* Clipped rectangle right edge (exclusive) */
  s32 y1;            /* Clipped rectangle top edge (exclusive) */
  u16 drawWidth;     /* Width of the visible clear region */
  u16 drawHeight;    /* Height of the visible clear region */
  u32 total_pixels;  /* Number of pixels that will be filled */
  u32 i;             /* Loop counter for pixel fill */

  /* Abort when no valid bitmap bounds are provided */
  if ((bmp == 0) || (bmp->width == 0) || (bmp->height == 0))
    return;

  x0 = (s32)x;
  y0 = (s32)y;
  x1 = (s32)x + (s32)bmp->width;
  y1 = (s32)y + (s32)bmp->height;

  /* Fast exits when the clear area is entirely off-screen on a given side */
  if (x1 <= 0) return;              /* Entirely left of the screen */
  if (y1 <= 0) return;              /* Entirely below the screen */
  if (x0 >= LCD_SCREEN_WIDTH) return;  /* Entirely right of the screen */
  if (y0 >= LCD_SCREEN_HEIGHT) return; /* Entirely above the screen */

  /* Clip the coordinates to the LCD boundaries to avoid wrap-around */
  if (x0 < 0) x0 = 0;
  if (y0 < 0) y0 = 0;
  if (x1 > LCD_SCREEN_WIDTH) x1 = LCD_SCREEN_WIDTH;   /* Restrict clear window to the panel width */
  if (y1 > LCD_SCREEN_HEIGHT) y1 = LCD_SCREEN_HEIGHT; /* Restrict clear window to the panel height */

  drawWidth = (u16)(x1 - x0);   /* Width of the region to erase */
  drawHeight = (u16)(y1 - y0);  /* Height of the region to erase */
  if ((drawWidth == 0u) || (drawHeight == 0u)) return; /* Nothing intersects */

  /* Issue a clipped fill over the surviving area */
  lcd_setAddressWindow((u16)x0,
                       (u16)y0,
                       (u16)(x1 - 1),
                       (u16)(y1 - 1));

  lcd_wr_reg(ILI9341_CMD_RAMWR); //RAM write command

  total_pixels = (u32)drawWidth * (u32)drawHeight; /* Convert area to pixel count */
  for (i = 0u; i < total_pixels; i++)
  {
    /* Push the background color for every pixel within the clipped box */
    lcd_wr_data(bg_color); //fill with background color
  }
}





